import React, { useState } from 'react';
import axios from 'axios';


const Starwar = props => {
    const [responseDatas, setResponseData] = useState([]);


    const callStarwarApi = () => {
        axios.get(`https://swapi.dev/api/`)
            .then(res => {
                setResponseData(res.data.results);
            })
            .catch(err => {
                console.log(err);
            });
    };

    return (


        <div>
            <div>
                <label>Search for: </label>
                <option onSelect={responseDatas.people}>People</option>
                <label>ID: </label>
                <input type="search" onSearch={(e) => {
                    return responseDatas.id
                }} />
            </div>
            {
                responseDatas.map((pokemons) => {
                    return (
                        <div>
                            <span>{pokemons.name}</span>
                        </div>
                    )
                })}
            {/* response.data.results */}
        </div>



    )
}

export default Pokemonapi;
